%Function Prototype for Piecewise Definition

function x = xt(t);
    if (t < - 2)
        x = -0;
    elseif (t >= -2 && t < -1 )
        x = t+2;
    elseif (t >= -1 && t < 1 )
        x = 1;
    elseif (t >= 1 && t < 3)
        x = (-0.5*t) + 1.5;
    else
        x = 0;
    end
end
%%
%For Signal A (original signal)

t = -5 : 0.001 : 5; % you may have to adjust the start and end value of t
x = zeros(size(t));
for i = 1 : 1 : length(x)
 x(i) = xt( t(i) );
end
disp("Plot for Original Signal") %[output:91f1abf5]
plot(t,x); %[output:13d13e96]
axis equal;  %[output:13d13e96]
%%
%For Signal B

t = -5 : 0.001 : 5; % you may have to adjust the start and end value of t
x = zeros(size(t));
for i = 1 : 1 : length(x)
 x(i) = xt( -t(i) - 2 );
end
disp("Plot for Signal with Function: x(-(t+2)) ") %[output:0ecb8669]
plot(t,x); %[output:79dbcce2]
axis equal;  %[output:79dbcce2]
%%
%For Signal C

t = -5 : 0.001 : 5; % you may have to adjust the start and end value of t
x = zeros(size(t));
for i = 1 : 1 : length(x)
 x(i) = xt( (3*t(i)) + 3 );
end
disp("Plot for Signal with Function: x(3(t+1)) ") %[output:78b551d6]
plot(t,x); %[output:6c25370f]
axis equal;  %[output:6c25370f]
%%
%For Signal D

t = -5 : 0.001 : 5; % you may have to adjust the start and end value of t
x = zeros(size(t));
for i = 1 : 1 : length(x)
 x(i) = xt( (-2*t(i)) + 4);
end
disp("Plot for Signal with Function: x(-2(t-2)) ") %[output:6fd2007d]
plot(t,x); %[output:56ad74b5]
axis equal;  %[output:56ad74b5]

